  // Forms Events
  onFormEvent(key: string, detail: any, formValueKey = null) {
    /**
   * This method debounces calls to createTableOfContents() to ensure that
   * entire Form is loaded/updated before generating TOC. Called each time a
   * "formChanged" event is emitted. Basically, the Form must NOT emit a
   * "formChanged" Event for the number of milliseconds specified in
   * "_updateDebounceTime" in order for "createTableOfContents()" to be called.
   */
    clearTimeout(this._formUpdateTimeout); // Reset timeout due to "formChanged" Event

    this._formUpdateTimeout = window.setTimeout(() => {
      this.createTableOfContents();
    }, this._updateDebounceTime);
  

    // DSPS-5997 angular changes for upload answersheet functionality
    if (  typeof this.existingwizarddata === 'string' &&
      this.existingwizarddata.length > 3 &&
      !this.answerSheetPopulated
    ) {
      this.initilExistingWizardData = JSON.parse(this.existingwizarddata);
      let t_details_1 = templatesListDetail.find((item) => {
        return item.tempValue == this.template;
      });
      console.log('existingwizarddata-->' + this.existingwizarddata);
      // CIDHSD-11994 : show manuscript title (excluding free text Opus snippets content) in angular screens on ada upload by setting non-array fields into manuscript_details array
      let manuscript_details = [];
      let gl_manuscript_details = [];
      //unique variable name declaration before for loop itself -must
      let n = 5;
      let m = 10;
      let o = 6;
      let p = 3;
      //this for loop should not have inner for loop again for endorsements list -its ongoing, closing at much below
      for (const [key, value] of Object.entries(
        this.initilExistingWizardData
      )) {
        if (value && !Array.isArray(value)) {
          this[t_details_1.tempId].nativeElement.setElementValue(
            key,
            String(value)
          );
        } else {
          this[t_details_1.tempId].nativeElement.setElementValue(key, value);
        }

        for (let i = 1; i < o; i++) {
          if (`manuscript_title_${i}` === key) {
            manuscript_details.push({ manuscript_title: value });
            this[formValueKey]?.nativeElement.setElementValue(
              'manuscript_details',
              manuscript_details
            );
          }
        }
      }
      this.answerSheetPopulated = true;

      //workaround for form validity status issue - this was occuring when there is no array component in fluid-form
      setTimeout(() => {
        this.validateForm(t_details_1.tempId);
      }, 100);
    }

    if (key === 'formChanged') {
      this.formValid = detail.valid;
      this.formErrors = detail.errors;
    }

    this.eventOutput[key] = detail;
  }

  async validateForm(tempId) {
    const result = await this[tempId].nativeElement.markTouchedAndValidate();

    console.log('result', result.valid);
    this.formValid = result.valid;
    this.formErrors = result.errors;
  }

  formSubmitted(events: any, formValueKey) {
    const formReference: ElementRef = this[formValueKey];
    formReference.nativeElement.markTouchedAndValidate().then((result) => {
      if (result.valid === false) {
        console.log('Invalid form!');
        return false;
      }
      let rawredactedValue = events.detail.data.redactedValue;

      //triggers on ada upload or recreate only - this is for legacy renewal to pass snippet data to Inspire
      //for this RTF editor in not required
      const manuscript_data = [];
      const manuscript_titles = [];
      const manuscript_data_arr = [];
      if (
        typeof this.existingwizarddata === 'string' &&
        this.existingwizarddata.length > 0
      ) {
        for (const [key, value] of Object.entries(
          this.initilExistingWizardData
        )) {
          for (let i = 1; i < 5; i++) {
            if (`manuscript_title_${i}` === key) {
              manuscript_titles.push({ manuscript_title: value });
            }
            if (`free_text_entry_${i}` === key) {
              manuscript_data.push({ free_text_entry: value });
            }
          }
        }
        for (let j = 0; j < manuscript_data.length; j++) {
          manuscript_data_arr.push({
            ...manuscript_titles[j],
            ...manuscript_data[j],
          });
        }
        rawredactedValue['manuscript_details'] = manuscript_data_arr;
      }

      this.finalPolicyData.next(rawredactedValue);
      console.log(events.detail.data);
    });
  }
